  input: '"TEXT","F3A","C00265298","All contributions reported on the 2003 July Quarterly
    report were reported in error to the 2002 election cycle when the report was generated
    and should have been for the 2004 election cycle.  This created excessive contributions
    that should have not happened and was incorrect.  Contributions assigned to Francisco
    J. Collazo were from a joint checking account with his wife Carmen A. Collazo
    and specified on the check was $2000 each for the 2004 Primary, $1,000 each for
    the 1992 Pimary debt and $1000 each for the 1992 General debt.  Those have been
    corrected.  Contributions made by Kimberly Collazo $1,000, Lisa Collazo $1,000
    and Joe Collazo $2,000 were incorrectly reported as debt and should have been
    reported for the 2004 Primary.  Those corrections have been made.  The contribution
    made by the Realtors on 3/03/2003 for $2,000 was reported incorrectly for the
    2004 Primary and should have been reported as 1992 General Debt.  That has been
    corrected."'
